import React, { useState } from 'react';
import { createClient } from '@supabase/supabase-js';

// TODO: Replace with your actual Supabase project URL and anon key
const SUPABASE_URL = 'https://pnpabkmytgxxlfhkhbdg.supabase.co';
const SUPABASE_ANON_KEY = 'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpc3MiOiJzdXBhYmFzZSIsInJlZiI6InBucGFia215dGd4eGxmaGtoYmRnIiwicm9sZSI6ImFub24iLCJpYXQiOjE3NTEyNjQ3MTMsImV4cCI6MjA2Njg0MDcxM30.sv0zS35FeiPnpgmnjjkjSmsnmE9vwZMgMVEosPggz1U';
const supabase = createClient(SUPABASE_URL, SUPABASE_ANON_KEY);

function LoginPage() {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [error, setError] = useState(null);
  const [loading, setLoading] = useState(false);
  const [success, setSuccess] = useState(false);

  const handleLogin = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError(null);
    setSuccess(false);
    const { error } = await supabase.auth.signInWithPassword({ email, password });
    setLoading(false);
    if (error) {
      setError(error.message);
    } else {
      setSuccess(true);
    }
  };

  return (
    <div className="relative min-h-screen flex items-center justify-center bg-gradient-to-br from-blue-50 via-purple-100 to-yellow-50 overflow-hidden">
      {/* Animated background blobs */}
      <div className="absolute -top-32 -left-32 w-96 h-96 bg-purple-200 rounded-full filter blur-3xl opacity-60 animate-blob1 z-0" />
      <div className="absolute -bottom-32 -right-32 w-96 h-96 bg-yellow-200 rounded-full filter blur-3xl opacity-60 animate-blob2 z-0" />
      <div className="absolute top-1/3 left-2/3 w-52 h-52 bg-teal-200 rounded-full filter blur-2xl opacity-40 animate-blob3 z-0" />
      <style>{`
        @keyframes blob1 {
          0% { transform: translateY(0) scale(1); }
          100% { transform: translateY(40px) scale(1.1); }
        }
        @keyframes blob2 {
          0% { transform: translateY(0) scale(1); }
          100% { transform: translateY(-40px) scale(1.1); }
        }
        @keyframes blob3 {
          0% { transform: translateX(0) scale(1); }
          100% { transform: translateX(-40px) scale(1.1); }
        }
        .animate-blob1 { animation: blob1 12s ease-in-out infinite alternate; }
        .animate-blob2 { animation: blob2 14s ease-in-out infinite alternate; }
        .animate-blob3 { animation: blob3 16s ease-in-out infinite alternate; }
        .fade-in-up { animation: fadeInUp 1s cubic-bezier(.23,1.01,.32,1) 0.2s both; }
        @keyframes fadeInUp {
          0% { opacity: 0; transform: translateY(40px) scale(0.98); }
          100% { opacity: 1; transform: translateY(0) scale(1); }
        }
        .spin { animation: spin 1s linear infinite; }
        @keyframes spin {
          0% { transform: rotate(0deg); }
          100% { transform: rotate(360deg); }
        }
      `}</style>
      <div className="fade-in-up relative z-10 bg-white/90 rounded-3xl shadow-2xl border border-blue-100 backdrop-blur-md px-10 py-12 w-full max-w-md">
        <h2 className="text-3xl font-bold text-center text-blue-900 mb-8 tracking-wide drop-shadow-sm">Sign In</h2>
        <form onSubmit={handleLogin}>
          <div className="mb-6">
            <label className="block text-blue-700 font-semibold mb-2">Email</label>
            <input
              className="w-full px-4 py-3 rounded-lg border border-blue-200 bg-blue-50 text-blue-900 text-base focus:outline-none focus:ring-2 focus:ring-blue-400 focus:border-blue-400 transition-all duration-200 shadow-sm"
              type="email"
              value={email}
              onChange={e => setEmail(e.target.value)}
              required
            />
          </div>
          <div className="mb-6">
            <label className="block text-blue-700 font-semibold mb-2">Password</label>
            <input
              className="w-full px-4 py-3 rounded-lg border border-blue-200 bg-blue-50 text-blue-900 text-base focus:outline-none focus:ring-2 focus:ring-blue-400 focus:border-blue-400 transition-all duration-200 shadow-sm"
              type="password"
              value={password}
              onChange={e => setPassword(e.target.value)}
              required
            />
          </div>
          <button
            className="w-full py-3 rounded-lg bg-gradient-to-r from-teal-400 via-blue-400 to-purple-400 text-white font-bold text-lg shadow-md hover:scale-105 hover:shadow-lg transition-all duration-200 active:scale-95 disabled:bg-blue-100 disabled:text-blue-300 disabled:cursor-not-allowed flex items-center justify-center"
            type="submit"
            disabled={loading}
          >
            {loading ? (
              <span className="flex items-center">
                <span className="inline-block w-5 h-5 border-2 border-white border-t-blue-400 rounded-full spin mr-2"></span>
                Logging in...
              </span>
            ) : 'Login'}
          </button>
          {error && <div className="text-red-500 mt-4 text-center font-medium transition-colors duration-200">{error}</div>}
          {success && <div className="text-teal-500 mt-4 text-center font-medium transition-colors duration-200">Login successful!</div>}
        </form>
      </div>
    </div>
  );
}

export default LoginPage;
